window.bookSummaryJSON = "<p>Dungeon: a place full of monsters, traps, treasure, and death. Those are the Great Dungeons, with unplumbed depths below the roots of the mountains. That's not for me. </p> <p>Dungeon: a place of rape, torture, and death, to control and corral enemies and slaves. These are the Red Cores, from which the mage-kings draw their power. That's also not for me. </p> <p>I don't like monsters. I don't want adventurers. I want to stay well away from enemies and slaves. Fortunately, there are alternatives.... </p> <p>A different sort of dungeon-core LitRPG novel.</p> <p>Includes explicit and consensual sexual content. Chapters containing such will be marked.</p>"; 
